script: |
  super -f tsv -I q3648.sql | sort > q3648.out

inputs:
  - name: q3648.sql
    data: |
      SELECT DISTINCT + - tab0.col2 + - tab0.col2 * + ( NULLIF ( - 95, tab0.col2 ) ) AS col0 FROM tab0 GROUP BY tab0.col2;
  - name: tab0

outputs:
  - name: q3648.out
    data: |
      2256
      3572
      7426
